import React, { Component } from 'react'
import styles from "./css/intro.module.css";

export default class Intro extends Component {
    render() {
        return (
            <div className={styles.solution}>
                <div className={styles.solution-description}>
                    <div className={styles.solution-head}>
                        {this.props.heading}
                        
                        <div  className={styles.solution-bio}>
                        {this.props.content}
                        </div>
                    </div>
                </div>
                <div className={styles.solution-image}>
                    <img src={this.props.imageurl} alt={this.props.heading + " Techronx"} />
                </div>
            </div>
        )
    }
}
